column726:
13/Mar/25 3:35 PM;andranik.melikyan;I attached drift testing data collected on 3-13-25.

 

3/12: Started measurement @ 13:55 PM and stopped on 3/13 @ 9:05 PM. Executed 256 Target Position 1 -> Target Position 2 -> Target Position 1 -> Target Position 3 cycles. Observed drift due to mechanical friction creating resistance on the Horizontal axis starting from 19:36 PM.  System drifted forward by about 20 mm. Data was collected at the rate of 1 sample/ 3 sec. Agilent DAQ was used for data acquisition.

 

3/13: Changed data acquisition tool from Agilent to Keysight. Data collection rate is 1 sample per 100 ms. Applied more oil to the Horizontal track (WD-40), restarted testing. Collecting CAN data with CANoe, Hall sensor Voltage, Linear potentiometer current and position with Keysight DAQ. Review and provide data by Monday, 3/17 or Friday, 3/14, if significant drift is observed;;;

