column739:
28/Jan/25 8:09 AM;michael.seck;The currents measured by the A2D are consistently higher than the current measured by the power supply and still have noise.  That being said, the current measured by the power supply seems to be a rough ARMS value (supplying more current than displayed).  The current measured by the A2D on motors M1, M7 and M8 seems to be higher than can be accounted for by the ARMS on the power supply.  We may be able to account for this by changing the current amplification on these motors to get a better "sweet" spot - but M7 (especially), is a non-BMW motor. If we are going to tailor our measurements, we need to decide which motor(s) to tailor the software to.

That being said, the current hardware/software is capable of "roughly" measuring current and detects stalls correctly.  We can determine current levels for each motor that can be identified as open circuit and short circuit conditions (short circuit detection is assisted by the SGD, where S2B/S2G is detected by VGS values).

We need to decide if we are going to pause investigation/tailoring the current measurement in order to press forward to develop the A-Sample functionality or if we should focus on correcting the current measurement bugs.  Note: These bugs MUST be solved before a production ECU is developed based on this design.;;;

